import React from 'react';
import './AdminDashboard.css';
import { useNavigate } from 'react-router-dom';

const AdminDashboard = () => {
    const navigate = useNavigate();
    const username = localStorage.getItem('username'); 

    const handleLogout = () => {
        console.log('Logging out...');
        navigate('/login', { replace: true });
    };

    return (
        <div class="min-h-screen flex">
        <aside class="w-64 bg-gray-800 text-white p-4">
          <ul class="space-y-2">
            {/* <li><a href="#" class="block py-2 px-4 bg-gray-900">Dashboard</a></li> */}
            <li><a href="/books" class="block py-2 px-4">Books Management</a></li>
            {/* <li><a href="/members" class="block py-2 px-4">Members</a></li> */}
          </ul>
        </aside>

        <main class="flex-1 p-6">
          <h1 class="text-2xl font-bold mb-4">Admin Dashboard</h1>
          <button className="librarian-logout-button" onClick={handleLogout}>Logout</button>

        </main>
      </div>

    );
};

export default AdminDashboard;
